        const whether = async()=>{
        const url =`
        http://api.openweathermap.org/data/2.5/weather?q=pune&appid=0709dcfb49669412f3ff11e260d26e06`
        const res = await fetch(url)
        const resp = await res.json()
        console.log(resp.main.temp);

        }
        whether()
    })
   
    return(
       
        <>
        <h2>current temperature is {temp}</h2>
        </>
    )
}
export default Whether;
